comment: >
  These tests are from an old script "test27" from the 1990s used to test
  nad27 init files with most of the SPCS zones.

  It was originally generated from execution of NMD's program l176, where the
  second pair of numbers are respective easting and northing output.

  Original versions of proj varied in the .001ft range with projections using
  Transverse Mercator due to greater precision of meridional distance function.
exe: proj
